TEST_P(GCSSpecificBadWKTTester, ParseBAD_WKT_Test)
{
    GeoCoordinates::BaseGCSPtr currentGCS;

    currentGCS = GeoCoordinates::BaseGCS::CreateGCS();

    // This WKT originates from a client for a 3MX
    WString wellKnownText = GetParam();

    EXPECT_FALSE(SUCCESS == currentGCS->InitFromWellKnownText(NULL, NULL, GeoCoordinates::BaseGCS::wktFlavorOGC, wellKnownText.c_str()));

    EXPECT_FALSE(currentGCS->IsValid());
}

    
